import React from "react";
import SpeedComponent from "./SpeedComponent";
import { generateSpeedData } from "../util/fakeData";

const Dashboard = ({speedData}) =>{
    const[speeds, setSpeeds] = useState(generateSpeedData())
    const{max, min, average} = generateSpeedData();

    return(    
    <div className='dashboard-container'>
        <header className='dasboard-header'>
            <h1>Speed Dashboard</h1>
        </header>

        <main className='dashboard-content'>
            <SpeedComponent max={speeds.max} min={speeds.min} average={speedData.average}/>
        </main>
    </div>)
}

export default Dashboard;
